/* eslint-disable react/jsx-no-duplicate-props */
/* eslint-disable react/prop-types */
/* eslint-disable react/react-in-jsx-scope */
// /* eslint-disable react/prop-types */
// /* eslint-disable react/react-in-jsx-scope */
import { Badge } from "react-bootstrap";

const TestimonialBadge = (props) => {
  const { testimonials } = props;
  const TestiBadge = testimonials
    .map((testimonial) => testimonial.Valuebadge > 0)
    .filter((value) => value.Valuebadge);

  return (
    <div>
      {TestiBadge > 0 && (
        <Badge bg="secondary"
          className="ms-1"
          data-toggle="tooltip"
          title={`${props.Valuebadge} testimonial(s)`}
        >{TestiBadge}</Badge>
      )}
    </div>
  );


};
export default TestimonialBadge;

